// Navbar.tsx
import React from 'react';
import { Link as RouterLink } from 'react-router-dom';
import logo from '../../assets/school_42.jpeg';
import './styles.css';

function Navbar() {
  return (
    // <nav className="navbar-container">
    //   <img className="logo" src={logo} alt="App Logo" />
    //   <div className="links-container">
    //       <RouterLink className="router-link" to="/">home</RouterLink>
    //       <RouterLink className="router-link" to="/game">game</RouterLink>
    //   </div>
    // </nav>

<div className="header">  
<div className="header__logo">
<img className="logo" src={logo} alt="App Logo" />
</div>
<nav className="navbar">
  <ul className="navbar__menu">
    <li class="navbar__item">
      <a href="#" class="navbar__link"><i></i><span>Home</span> </a>
    </li>
    <li class="navbar__item">
      <a href="#" class="navbar__link"><i></i><span>Messages</span></a>        
    </li>
    <li class="navbar__item">
      <a href="#" class="navbar__link"><i></i><span>Customers</span></a>        
    </li>
    <li class="navbar__item">
      <a href="#" class="navbar__link"><i></i><span>Projects</span></a>        
    </li>
    <li class="navbar__item">
      <a href="#" class="navbar__link"><i></i><span>Resources</span></a>        
    </li>
    <li class="navbar__item">
      <a href="#" class="navbar__link"><i></i><span>Help</span></a>        
    </li>
    <li class="navbar__item">
      <a href="#" class="navbar__link"><i></i><span>Settings</span></a>        
    </li>
  </ul>
</nav>
</div>

  );
}

export default Navbar;
